# Categorical values
PRODUCT_TYPES = ['haircare', 'skincare', 'cosmetics']
CUSTOMER_DEMOGRAPHICS = ['Non-binary', 'Female', 'Unknown', 'Male']
SHIPPING_CARRIERS = ['Carrier B', 'Carrier A', 'Carrier C']
SUPPLIER_NAMES = ['Supplier 3', 'Supplier 1', 'Supplier 5', 'Supplier 4', 'Supplier 2']
LOCATIONS = ['Mumbai', 'Kolkata', 'Delhi', 'Bangalore', 'Chennai']
INSPECTION_RESULTS = ['Pending', 'Fail', 'Pass']
TRANSPORTATION_MODES = ['Road', 'Air', 'Rail', 'Sea']
ROUTES = ['Route B', 'Route A', 'Route C']

# Numerical value ranges (min/max from original data)
NUMERICAL_RANGES = {
    'Price': (1.00, 99.99),
    'Availability': (1, 100),
    'Number of products sold': (1, 999),
    'Revenue generated': (1000.00, 9999.99),
    'Stock levels': (0, 100),
    'Lead times': (1, 30),
    'Order quantities': (1, 100),
    'Shipping times': (1, 10),
    'Shipping costs': (1.00, 10.00),
    'Lead time': (1, 30),
    'Production volumes': (100, 999),
    'Manufacturing lead time': (1, 30),
    'Manufacturing costs': (1.00, 100.00),
    'Defect rates': (0.01, 5.00),
    'Costs': (100.00, 999.99)
}

def generate_random_data(num_rows):
    """
    Generates a specified number of random data rows
    that follow the patterns of the original dataset.
    """
    new_rows = []
    
    # We will start SKUs from SKU100 to avoid conflicts with the original data
    for i in range(100, 100 + num_rows):
        row = {
            'Product type': random.choice(PRODUCT_TYPES),
            'SKU': f"SKU{i}",
            'Price': round(random.uniform(*NUMERICAL_RANGES['Price']), 2),
            'Availability': random.randint(*NUMERICAL_RANGES['Availability']),
            'Number of products sold': random.randint(*NUMERICAL_RANGES['Number of products sold']),
            'Revenue generated': round(random.uniform(*NUMERICAL_RANGES['Revenue generated']), 2),
            'Customer demographics': random.choice(CUSTOMER_DEMOGRAPHICS),
            'Stock levels': random.randint(*NUMERICAL_RANGES['Stock levels']),
            'Lead times': random.randint(*NUMERICAL_RANGES['Lead times']),
            'Order quantities': random.randint(*NUMERICAL_RANGES['Order quantities']),
            'Shipping times': random.randint(*NUMERICAL_RANGES['Shipping times']),
            'Shipping carriers': random.choice(SHIPPING_CARRIERS),
            'Shipping costs': round(random.uniform(*NUMERICAL_RANGES['Shipping costs']), 2),
            'Supplier name': random.choice(SUPPLIER_NAMES),
            'Location': random.choice(LOCATIONS),
            'Lead time': random.randint(*NUMERICAL_RANGES['Lead time']),
            'Production volumes': random.randint(*NUMERICAL_RANGES['Production volumes']),
            'Manufacturing lead time': random.randint(*NUMERICAL_RANGES['Manufacturing lead time']),
            'Manufacturing costs': round(random.uniform(*NUMERICAL_RANGES['Manufacturing costs']), 2),
            'Inspection results': random.choice(INSPECTION_RESULTS),
            'Defect rates': round(random.uniform(*NUMERICAL_RANGES['Defect rates']), 2),
            'Transportation modes': random.choice(TRANSPORTATION_MODES),
            'Routes': random.choice(ROUTES),
            'Costs': round(random.uniform(*NUMERICAL_RANGES['Costs']), 2)
        }
        new_rows.append(row)
        
    return new_rows

